import { Navbar, Container, Nav, NavLink } from 'react-bootstrap';

function Header(){
    return(
        <Navbar bg="light">
        <Container>
          <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Container>
      </Navbar>
    );
}

export default Header;
